import React from 'react';
import { Radar } from 'react-chartjs-2';

const data = {
  labels: ['Song 1', 'Song 2', 'Song 3', 'Song 4', 'Song 5', 'Song 6', 'Song 7', 'Song 8', 'Song 9', 'Song 10'],
  datasets: [
    {
      label: 'Popularity',
      backgroundColor: 'rgba(29, 185, 84, 0.2)',
      borderColor: 'rgba(29, 185, 84, 1)',
      pointBackgroundColor: 'rgba(29, 185, 84, 1)',
      pointBorderColor: '#fff',
      pointHoverBackgroundColor: '#fff',
      pointHoverBorderColor: 'rgba(29, 185, 84, 1)',
      data: [65, 59, 80, 81, 56, 55, 40, 20, 10, 90],
    },
  ],
};

const options = {
  responsive: true,
  maintainAspectRatio: false,
  scale: {
    ticks: {
      beginAtZero: true,
      max: 100,
    },
  },
};

const RadarChart = () => (
  <div style={{backgroundColor: '#F5F5F5', padding: '20px'}}>
    <h2 style={{textAlign: 'center', color: '#1DB954'}}>Radar Chart of Top 10 Songs Popularity</h2>
    <Radar data={data} options={options} />
  </div>
);

export default RadarChart;
